const Navbar = () => {
    return (
        <>
            <div className="navbar">
                <div className="navBarLogo">
                    <img src="logo.png" alt="Logo" />
                </div>
                <div className="nav-btns">
                    <button href="#">Login</button>
                    <button href="#">Register</button>
                    <button href="#">Personal Area</button>
                </div>
            </div>
        </>
    );
};

export default Navbar;
